swagger: '2.0'
info:
  title: API "MAGAZINE"
  description: Backend version for magazine
  version: 1.0.0

paths:
  /api/category:
    get:
      summary: Get all categories
      tags: [Category]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/category/create:
    post:
      summary: Create new category
      tags: [Category]
      parameters:
        - name: body
          in: body
          type: object
          example: { 
            title: "Худі",
            typeCategoryId: 1,
            photo: ["data:image/png;base64,"],
          }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/type/category:
    get:
      summary: Get all types Category
      tags: [Category]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/category/delete:
    delete:
      summary: Delete category
      tags: [Category]
      parameters:
        - name: body
          in: body
          type: object
          example: { id: 1 }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/banner:
    get:
      summary: Get all news in banner
      tags: [Banner]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/banner/create:
    post:
      summary: Create news in banner
      tags: [Banner]
      parameters:
        - name: body
          in: body
          type: object
          example: { 
            title: "Літня колекція", 
            description: "Для самих витончених", 
            bottom_description: "Акція діє до 12.05", 
            link: "/catalog", 
            discount: 10, 
            photo: [ "data:image/jpeg;base64," ]
          }
      responses:
        200:
          schema:
            type: object
            example:
              {
                status: 200,
                message: 'Новини для банера були створені',
              }
  /api/banner/delete:
    delete:
      summary: Delete new banner
      tags: [Banner]
      parameters:
        - name: body
          in: body
          type: object
          example: { id: 1 }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/products:
    get:
      summary: Get all products
      tags: [Products]
      parameters:
        - in: query
          name: page
          type: string
        - in: query
          name: pageSize
          type: string
        - in: query
          name: search
          type: string
        - in: query
          name: id
          type: string
        - in: query
          name: sort
          type: string
        - in: query
          name: categoryId
          type: number
        - in: query
          name: priceRange
          type: array
          example: [0,10000]
        - in: query
          name: size
          type: array
          example: ["X","L","XL"]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/products/interest:
    get:
      summary: Get interest products
      tags: [Products]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }      
  /api/products/create:
    post:
      summary: Create new products
      tags: [Products]
      parameters:
        - name: body
          in: body
          type: object
          example: {
            title: "Актуальная футболка с фактурным принтом",
            description: "<p><strong>Материалы:</strong> супрем (100% бавовна)</p><p><strong>Длина рукава:</strong> S - 20 см, M - 20 см, L - 20 см</p><p><strong>Длина изделия:</strong> S - 63 см, M - 64,5 см, L - 66 см</p><p><strong>Ширина под проймами:</strong> S - 46 см, M - 48 см, L - 50 см</p><p><strong>Примечание:</strong> Замеры могут отличаться в разных расцветках и размерах.&#13;
            Изображения и цвет представленного товара могут незначительно&#13;
            отличаться от оригинала продукции, в зависимости от разрешения&#13;
            и настроек вашего монитора, а также условий освещения при съемке.&#13;
            Убедительная просьба для уточнения цвета и иных характеристик&#13;
            товаров обращаться к менеджеру.&#13;
            На модели размер S, параметры модели: 85-60-90, рост 172.</p>
            ",
            discount: 0,
            price: 100,
            vendorCode: 2143,
            param: [ "Чорний, Белый, Голубой, Желтый, Лавандовый, Фисташковый", "S, M, L" ],
            photo: [ "data:image/jpeg;base64," ],
          }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/product/delete:
    delete:
      summary: Delete product
      tags: [Products]
      parameters:
        - name: body
          in: body
          type: object
          example: { id: 1 }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/collections:
    get:
      summary: Get all collections
      tags: [Collections]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/collections/delete:
    delete:
      summary: Delete collection
      tags: [Collections]
      parameters:
        - name: body
          in: body
          type: object
          example: { id: 1 }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/collection/create:
    post:
      summary: Create collection
      tags: [Collections]
      parameters:
        - name: body
          in: body
          type: object
          example: { 
            title: "Літній Вітер",
            arrProduct: [ 123,43, 22 ]
          }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/collection/update:
    put:
      summary: Update collection values
      tags: [Collections]
      parameters:
        - name: body
          in: body
          type: object
          example: { 
            id: 1,
            arrProduct: [ 123,43, 22 ]
          }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: "" }
  /api/orders:
    get:
      summary: Get all orders users
      tags: [Order]
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/order/my:
    post:
      summary: Get current users orders
      tags: [Order]
      parameters:
        - name: body
          in: body
          type: object
          example: { 
            arrProduct: [1,4,2]
          }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, data: [] }
  /api/order/create:
    post:
      summary: create new order
      tags: [Order]
      parameters:
        - name: body
          in: body
          type: object
          example: { 
            first_name: "Віктор",	
            middle_name: "Перо",	
            last_name: "Сергійович",	
            email: "viktor32@gmail.com",	
            phone: "+380685428762",
            payment: "when_take",
            deliveryType: "novapochta",
            addresss: "",
          }
      responses:
        200:
          schema:
            type: object
            example: { status: 200, message: ""  }